  $(document).on('submit', ".formAjax", function (e) {
    e.preventDefault();
    var $form = $(this);
    if ($form.find("input").hasClass("error")) return;
    var $submitBtn = $form.find('.js-form-ajax-btn');
    var defaultTextBtn = $submitBtn.html();
    var $errorContainer = $form.find('.js-form-ajax-error');
    var fd = new FormData(this);
    $.ajax(
      {
        url: $form.attr("action"),
        type: "POST",
        data: fd,
        dataType: "json",
        processData: false,
        contentType: false,
        beforeSend: function () {
          $errorContainer.html();
          $submitBtn
            .html(' ...')
            .prop('disabled', true);
        },
        success: function (data) {
          $submitBtn
            .prop('disabled', false)
            .html(defaultTextBtn);

          if (data.status === 1) {
            $.fancybox.open({
              src: data.popup,
              type: 'ajax'
            });
            setTimeout(function () {
              $.fancybox.close();
            }, 3000);

            $form.find('input').val('');
            $form.find('input[type="number"]').val(0);
            $errorContainer.html("")
          } else {
            $errorContainer.html('<div>' + data.error + '</div>');
          }
        },
        error: function (xhr, status, errorString) {
          $errorContainer.html('<div>' + errorString + '</div>');
          $submitBtn
            .prop('disabled', false)
            .html(defaultTextBtn);
        }
      });
  });

